","keccak256":"0xa1e8e83cd0087785df04ac79fb395d9f3684caeaf973d9e2c71caef723a3a5d6","license":"MIT"},"contracts/Character.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "erc721a/contracts/ERC721A.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

enum DiscType {
    FARMER,
    BULL,
    BEAR
}

import "hardhat/console.sol";

interface IPepe is IERC20 {
    function burnPepe(address sender, uint amount_) external;
}

interface IPepeDisc is IERC721Enumerable {
    function returnDiscType(uint tokenId) external view returns (DiscType);

    function returnDiscLevel(uint index) external view returns (uint);

    function burnFromContract(uint discID_) external;
}

contract Character is ERC721Enumerable, Ownable {
    constructor() ERC721("Characters", "PC") {}

    struct Mintable {
        uint tokenID;
        DiscType discType;
        uint mintable;
    }

    bool public saleIsActive = false;

    uint256 public farmerPrice = 0; //1000;
    uint256 public farmersTime1 = 1 hours; //56 hours;
    uint256 public farmersTime2 = 1 hours; //41 hours;
    uint256 public farmersTime3 = 1 hours; //28 hours;

    uint256 public bullPrice = 0; //1500;
    uint256 public bullsTime1 = 1 hours; //84 hours;
    uint256 public bullsTime2 = 1 hours; //61 hours;
    uint256 public bullsTime3 = 1 hours; //42 hours;

    uint256 public bearPrice = 0; //3000;
    uint256 public bearsTime1 = 1 hours; //168 hours;
    uint256 public bearsTime2 = 1 hours; //123 hours;
    uint256 public bearsTime3 = 1 hours; //84 hours;

    string private _nftBaseURI;
    address public pepeDiscAddress;
    address public pepeStakingAddress;

    mapping(uint => uint) public newTokenUri;
    mapping(DiscType => uint) public rarityPerToken;
    mapping(uint => DiscType) public tokenPerRarity;
    mapping(uint => bool) public idAlreadyMinted;

    function setPepeDiscAddress(address pepeDiscAddress_) public onlyOwner {
        pepeDiscAddress = pepeDiscAddress_;
    }

    function setPepeStakingAddress(
        address pepeStakingAddress_
    ) public onlyOwner {
        pepeStakingAddress = pepeStakingAddress_;
    }

    function flipSaleState() public onlyOwner {
        saleIsActive = !saleIsActive;
    }

    mapping(address => Mintable[]) public mintableCharacters;

    function setBaseURI(string calldata nftBaseURI_) public onlyOwner {
        _nftBaseURI = nftBaseURI_;
    }

    //unreveal?
    function tokenURI(
        uint256 tokenID_
    ) public view virtual override returns (string memory) {
        string memory uriAddition = "";
        uint getTokenURI;
        _requireMinted(tokenID_);
        if (tokenPerRarity[tokenID_] == DiscType.FARMER) {
            uriAddition = "1/";
            getTokenURI = newTokenUri[tokenID_];
        } else if (tokenPerRarity[tokenID_] == DiscType.BULL) {
            uriAddition = "2/";
            getTokenURI = newTokenUri[tokenID_];
        } else if (tokenPerRarity[tokenID_] == DiscType.BEAR) {
            uriAddition = "3/";
            getTokenURI = newTokenUri[tokenID_];
        }
        return
            string.concat(
                _nftBaseURI,
                uriAddition,
                Strings.toString(getTokenURI)
            );
    }

    function calculateTokenPrice(
        DiscType discType_
    ) public view returns (uint) {
        uint price;
        if (discType_ == DiscType.FARMER) {
            price = farmerPrice;
        } else if (discType_ == DiscType.BEAR) {
            price = bearPrice;
        } else {
            price = bullPrice;
        }

        return (price);
    }

    function calculateTokenTime(
        DiscType discType_,
        uint discLevel_
    ) internal view returns (uint) {
        uint targetTime;

        if (discType_ == DiscType.FARMER) {
            if (discLevel_ < 2) {
                targetTime = block.timestamp + farmersTime1;
            } else if (discLevel_ == 2) {
                targetTime = block.timestamp + farmersTime2;
            } else {
                targetTime = block.timestamp + farmersTime3;
            }
        } else if (discType_ == DiscType.BULL) {
            if (discLevel_ < 2) {
                targetTime = block.timestamp + bullsTime1;
            } else if (discLevel_ == 2) {
                targetTime = block.timestamp + bullsTime2;
            } else {
                targetTime = block.timestamp + bullsTime3;
            }
        } else {
            if (discLevel_ < 2) {
                targetTime = block.timestamp + bearsTime1;
            } else if (discLevel_ == 2) {
                targetTime = block.timestamp + bearsTime2;
            } else {
                targetTime = block.timestamp + bearsTime3;
            }
        }

        return targetTime;
    }

    function prepareMint(uint discID_, uint pepePrice_) public {
        IPepeDisc pepeDisc = IPepeDisc(pepeDiscAddress);
        IPepe pepeStaking = IPepe(pepeStakingAddress);
        require(
            pepeStaking.balanceOf(msg.sender) >= pepePrice_,
            "you need more $PEPE"
        );
        require(
            pepeDisc.ownerOf(discID_) == msg.sender,
            "you are not the owner!"
        );
        DiscType discType = pepeDisc.returnDiscType(discID_);

        uint price = calculateTokenPrice(discType);
        require(pepePrice_ >= price, "need more $PEPE!");

        uint discLevel = pepeDisc.returnDiscLevel(discID_);

        Mintable memory mintable = Mintable({
            tokenID: discID_,
            discType: discType,
            mintable: calculateTokenTime(discType, discLevel)
        });

        pepeDisc.burnFromContract(discID_);
        pepeStaking.burnPepe(msg.sender, price);
        mintableCharacters[msg.sender].push(mintable);
    }

    function getAllMyCharacters(
        address ownerOfCharacters_
    ) public view returns (Mintable[] memory) {
        Mintable[] memory mintable = mintableCharacters[ownerOfCharacters_];
        return mintable;
    }

    function getMintableCharacter(
        address ownerOfCharacters_,
        uint mintID_
    ) public view returns (Mintable memory) {
        Mintable[] memory mintable = mintableCharacters[ownerOfCharacters_];
        Mintable memory readyToMint;

        for (uint i = 0; i < mintable.length; i++) {
            if (mintable[i].tokenID == mintID_) {
                readyToMint = mintable[i];
            }
        }

        return readyToMint;
    }

    function mintMyCharacter(uint mintID_) public {
        require(saleIsActive, "sale is not open");
        Mintable memory character = getMintableCharacter(msg.sender, mintID_);
        require(
            character.mintable <= block.timestamp && character.mintable > 0,
            "not ready for minting"
        );
        require(!idAlreadyMinted[mintID_], "already minted that character");

        uint id = totalSupply();

        idAlreadyMinted[mintID_] = true;
        tokenPerRarity[id] = character.discType; //speichern der Seltenheit der Tokens
        newTokenUri[id] = rarityPerToken[character.discType]; // token #212 -> 37
        rarityPerToken[character.discType] += 1; //Zähler für die Seltenheit
        _safeMint(msg.sender, id);
    }

    function isApprovedForAll(
        address owner,
        address operator
    ) public view virtual override(ERC721, IERC721) returns (bool) {
        if (operator == pepeStakingAddress) {
            return true;
        }
        return super.isApprovedForAll(owner, operator);
    }

    receive() external payable {}

    function withdraw() public onlyOwner {
        uint256 _balance = address(this).balance;
        (bool os, ) = payable(owner()).call{value: _balance}("");
        require(os);
    }
}
